import React from "react";
import Header from "./Header";
import Footer from "./footer";
import Note from "./Note";
import notes from "../notes";

function App(){
    return <div><Header /><Note title={notes[0].title} content={notes[0].content}/><Footer /></div>;
}

export default App;
